Graham Livesey, &quot;Gordon Atkins: Architecture 1960-95&quot; 
2005 | ISBN-10: 1552381250 | 135 pages | PDF | 78 MB

This book explores numerous aspects of this architect's significant &amp; often overlooked body of work. Primarily focussing on visual material, such as Atkins' own drawings &amp; photographs, this book features eighteen projects that span most of his career. Included is an interview with Atkins that explores in detail his design philosophy, formative training, &amp; upbringing
